import React from 'react'
import './index.css';
import Cocktail from '../components/Cocktail'



export default class CocktailIndexContainer extends React.Component{

    render(){
        return(
            <div className="container-fluid" id="index-container">
                <ul class="smooth-scroll list-unstyled">
                   <li>
               {
                       this.props.cocktails.map(cocktail=>{
                          return <Cocktail key={cocktail.name} cocktail={cocktail}/>
                         })
                }
                   </li>
               </ul>
            </div>

        )
    }

}
